/**
 * @author Rafal Cymbalista
 * @class Project
 * @description Project Entity
 * @property {String} name
 * @property {ObjectID} deliveryType
 * @property {ObjectID} ops
 * @property {ObjectID} sm
 * @property {Number} cim
 * @property {Number} ras
 * @property {ObjectID} status
 */
export default class Project {
   /**
    * @constructor
    * @public
    * @param {String} name
    * @param {ObjectID} deliveryType
    * @param {ObjectID} ops
    * @param {ObjectID} sm
    * @param {Number} cim
    * @param {Number} ras
    * @param {ObjectID} status
    */
   constructor(name, deliveryType, ops, sm, cim, ras, status) {
      this.name = name;
      this.deliveryType = deliveryType;
      this.ops = ops;
      this.sm = sm;
      this.cim = cim;
      this.ras = ras;
      this.status = status;
   }
   /**
    * @public
    * @returns {Project} DTO
    */
   getProjectDTO() {
      return {
         project: {
            name: this.name,
            deliveryType: this.deliveryType,
            ops: this.ops,
            sm: this.sm,
            cim: this.cim,
            ras: this.ras,
            status: this.status
         }
      };
   }
}
